import{_ as t,c as o,o as e,a2 as s}from"./chunks/framework.DoPyCSkJ.js";const a="/blog.fenotes.com/assets/git_flow.DauEfKkd.webp",i="/blog.fenotes.com/assets/flow.Cu-I3b8b.jpg",h=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"unit1/gitFlow.md","filePath":"unit1/gitFlow.md","lastUpdated":1660123365000}'),l={name:"unit1/gitFlow.md"},r=s('<blockquote><p>平安蜀黍的前端教程 &gt; 备选知识点 &gt; git 版本管理流程之 gitflow</p></blockquote><h2 id="gitflow-流程图" tabindex="-1">GitFlow 流程图 <a class="header-anchor" href="#gitflow-流程图" aria-label="Permalink to &quot;GitFlow 流程图&quot;">​</a></h2><img src="'+a+'"><p>如上图所示：</p><ul><li><p><strong>master 分支</strong> 作为项目的基本分支，项目只有在真实部署上线时才可以合并到 master 分支，并在合并完成后以 Tag 的方式标记并上线。</p></li><li><p><strong>develop 分支</strong> 作为项目的开发分支，它的存在是为了在每一次功能分支的代码完成后部署到线上之前能有一个分支用于对代码进行合并、储存以及必要的回退操作。develop 分支的代码</p></li><li><p><strong>feature 分支</strong> 作为功能分支，它是多线的，项目可能会存在多个功能同期并列开发的情况，这时候我们就需要建立多个功能分支。当其中某一个功能开发完成且测试通过后可以合并到 develop 分支，这时候开启的新功能分支可以保证代码的完整度。如果当前合并后的分支需要上线的话还要通过进一步测试且通过后将代码合并到 release 分支，最终合并到主分支并进行部署上线。</p></li><li><p><strong>release 分支</strong> 版本分支，这个分支主要用于替代主分支进行一些合并操作，避免开发分支直接往主分支合并时出现异常或错误导致更多的麻烦发生。有了 Release 分支后，我们可以保证合并到主分支的代码是绝对安全的。</p></li><li><p><strong>HotFixes 分支</strong> 临时分支，一般用于解决线上发生的紧急性功能问题，这个分支的代码测试通过后会直接合并到主分支与开发分支。</p></li></ul><p><strong>注意：GIT 的管理流程有很多种，而且也不是固定模式的，你们将来可能需要面对一种完全不同的版本管理流程，所以需要理解的是上面提到的这些分支存在的意义，这样无论你以后需要面对什么样的版本流程都能做到游刃有余。</strong></p><h2 id="与-gitflow-流程匹配的功能开发流程" tabindex="-1">与 GitFlow 流程匹配的功能开发流程 <a class="header-anchor" href="#与-gitflow-流程匹配的功能开发流程" aria-label="Permalink to &quot;与 GitFlow 流程匹配的功能开发流程&quot;">​</a></h2><img src="'+i+'"><p><strong>功能开发流程需要与 Git 管理流程匹配</strong></p>',9),n=[r];function p(g,_,c,d,f,m){return e(),o("div",null,n)}const w=t(l,[["render",p]]);export{h as __pageData,w as default};
